// Componente para mostrar las tareas de un tipo de deber
import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

@Component({
  selector: 'app-category',
  standalone: true,
  templateUrl: './category.component.html',
  styleUrls: [],
  imports: [CommonModule, FormsModule]
})
export class CategoryComponent {
  taskTypeName: string = '';
  tasks: {
    nombre: string;
    nota?: string;
    fecha?: string;
    estado: 'realizado' | 'pendiente' | 'no realizado' | 'para hoy';
  }[] = [];

  constructor(private route: ActivatedRoute, private router: Router) {}

  // Inicializa con el nombre del tipo de tarea
  ngOnInit(): void {
    this.taskTypeName = this.route.snapshot.paramMap.get('type') || '';
    console.log('[INIT] Tareas para tipo:', this.taskTypeName);
    this.loadTasks();
  }

  // Carga tareas simuladas (reemplazar con fetch real)
  loadTasks(): void {
    this.tasks = [
      { nombre: 'Matem√°ticas', nota: 'Repasar antes del examen', fecha: '15', estado: 'pendiente' },
      { nombre: 'Historia', nota: '', fecha: '', estado: 'para hoy' },
      { nombre: 'Ingl√©s', nota: 'Tarea del libro', fecha: '12', estado: 'realizado' },
    ];
  }

  // Regresa al home
  goBack(): void {
    this.router.navigate(['/app/home']);
  }

  // Abre modal para agregar
  openAddModal(): void {
    console.log('[MODAL] Abrir agregar tarea');
  }

  // Edita tarea
  editTask(task: any): void {
    console.log('[EDIT] Tarea:', task);
  }

  // Elimina tarea
  deleteTask(task: any): void {
    console.log('[DELETE] Tarea:', task);
  }
}
<!-- Header con bot√≥n para volver -->
<div class="flex items-center justify-between p-4 border-b mb-4">
  <h2 class="text-xl font-bold">Tareas del Tipo: {{ taskTypeName }}</h2>
  <button (click)="goBack()" class="text-blue-600 hover:underline flex items-center gap-1">
    <span class="material-icons">arrow_back</span> Regresar
  </button>
</div>

<!-- Tabla de tareas -->
<div class="overflow-x-auto">
  <table class="min-w-full border border-gray-300 text-sm text-left">
    <thead class="bg-gray-100 text-gray-700">
      <tr>
        <th class="px-4 py-2 border">Nombre</th>
        <th class="px-4 py-2 border">Nota</th>
        <th class="px-4 py-2 border">Fecha</th>
        <th class="px-4 py-2 border">Estado</th>
        <th class="px-4 py-2 border text-center">Acciones</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let task of tasks" class="hover:bg-gray-50">
        <td class="px-4 py-2 border">{{ task.nombre }}</td>
        <td class="px-4 py-2 border">{{ task.nota || '-' }}</td>
        <td class="px-4 py-2 border">{{ task.fecha || '(por definir)' }}</td>
        <td class="px-4 py-2 border">
          <span class="font-semibold" [ngClass]="task.estado">
            {{ task.estado }}
          </span>
        </td>
        <td class="px-4 py-2 border text-center">
          <button (click)="editTask(task)" class="text-blue-600 text-lg px-1">‚úèÔ∏è</button>
          <button (click)="deleteTask(task)" class="text-red-600 text-lg px-1">üóëÔ∏è</button>
        </td>
      </tr>
    </tbody>
  </table>
</div>

<!-- Bot√≥n para agregar nueva tarea -->
<button (click)="openAddModal()"
        class="fixed bottom-6 right-6 bg-green-500 hover:bg-green-600 text-white text-3xl w-14 h-14 rounded-full shadow-lg flex items-center justify-center">
  +
</button>
